import logo from './logo.svg';
import './App.css';
import Sidenav from './components/Sidenav';
import Line from './components/Line';
import Pie from './components/Pie';
import Table from './components/Table';
import Profile from './components/Profile';
import User from './components/User';

import UserPic from '../assets/media.png'
import Facebook from '../assets/facebook.png'
import Insta from '../assets/instagram.png'
import Twitter from '../assets/twitter.png'

function Home() {
  return (
    <div className='main pe-4'>
      <div className='row'>
        <Profile />
      </div>
      <div className='row' id='content'>
        <div className='card col-lg-6'>
          <Line />
        </div>
        <div className='card col-lg-4'>
          <Pie />
        </div>
        <div className='card col-lg-8 p-0'>
          <Table />
        </div>
        <div className='card col-lg-3 p-0'>
          {/* <User /> */}
          <img class="card-img-top" src={UserPic} alt="profilePic" />
          <div class="card-body">
            <h5 class="card-title">John Doe</h5>
            <p class="card-text text-secondary">CEO</p>
            <span>
              <img src={Facebook} alt="facebook" />
              <img src={Insta} alt="facebook" />
              <img src={Twitter} alt="facebook" />
            </span>
          </div>
        </div>
      </div>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Sidenav />
      <Home />
    </div>
  );
}

export default App;
